import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Table, Tr, Th, Td } from 'reactable';

const View = () => {
  const [designPaths, setDesignPaths] = useState([]);
  const [designVariables, setDesignVariables] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const pathsResponse = await axios.get('/design-paths');
        const variablesResponse = await axios.get('/design-variables');
        setDesignPaths(pathsResponse.data);
        setDesignVariables(variablesResponse.data);
      } catch (error) {
        console.error(error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <h2>Design Paths</h2>
      <Table className="table">
        <thead>
          <Tr>
            <Th>defDirectory</Th>
            <Th>lefDirectory</Th>
            <Th>libDirectory</Th>
            <Th>techDirectory</Th>
          </Tr>
        </thead>
        <tbody>
          {designPaths.map((design) => (
            <Tr key={design._id}>
              <Td column="defDirectory">{design.defDirectory}</Td>
              <Td column="lefDirectory">{design.lefDirectory}</Td>
              <Td column="libDirectory">{design.libDirectory}</Td>
              <Td column="techDirectory">{design.techDirectory}</Td>
            </Tr>
          ))}
        </tbody>
      </Table>

      <h2>Design Variables</h2>
      <Table className="table">
        <thead>
          <Tr>
            <Th>design</Th>
            <Th>num_cpu</Th>
            <Th>power_opt</Th>
            <Th>gen_eff</Th>
          </Tr>
        </thead>
        <tbody>
          {designVariables.map((variable) => (
            <Tr key={variable._id}>
              <Td column="design">{variable.design}</Td>
              <Td column="num_cpu">{variable.num_cpu}</Td>
              <Td column="power_opt">{variable.power_opt}</Td>
              <Td column="gen_eff">{variable.gen_eff}</Td>
            </Tr>
          ))}
        </tbody>
      </Table>
    </div>
  );
};

export default View;
